export const isGroupType = (type) => type === 'group' || type === 'kubeGroup';
export function isGroup(node) {
    return isGroupType(node.type);
}
/**
 * Iterates graph, breadth first
 */
export function forEachNode(graph, cb) {
    cb(graph);
    if ('nodes' in graph.data) {
        graph.data.nodes.forEach(it => forEachNode(it, cb));
    }
}
